records = ""

def base64_gzipped_yaml_to_hash(base64_string)
  # 1. Decode the Base64 string
  compressed_data = Base64.decode64(base64_string)

  # 2. Gunzip (inflate) the data
  yaml_str = Zlib::Inflate.inflate(compressed_data)

  # 3. Load the YAML into a Ruby object (Hash)
  YAML.load(yaml_str)
end


recs = base64_gzipped_yaml_to_hash(records)

recs.each do |record|
  id = record[0]
  old = record[1]
  fix = record[2]

  s = Source.find(id)

  puts s.marc.first_occurance("245", "a").content

  s.marc.each_by_tag("245") do |t|
    tgs = t.fetch_all_by_tag("a")
    tgs.each do |st|
      if st.content.include?(old)
        st.content.gsub!(old, fix)
      end
    end
  end

  s.paper_trail_event ="Fix 245 #{old}".truncate(255)
  puts s.marc.first_occurance("245", "a").content.red

  s.save

end